import React from 'react';
import '../style/About.css';
import logotipo from '../style/img/logotipo_oro.png';

function About() {
    return (
        <div>

            <div class='welcome-mensage-cont '>
                <img src={logotipo} alt="widespace" width='300rem' />
                <div class='welcome-mensage '>
                    <h1>
                        Sobre nosotros:
                </h1>
                    <p>WIDESPACE ctd. fue establecido en 1994 que es una empresa de alta tecnología nacional especializada en la investigación y la fabricación de las herramientas diamantadas de las herramientas eléctricas y de las herramientas del TCT, Bosun hay tres subsidiarios de ultramar en los Estados Unidos, el Canadá y el Brasil, situado en zona de alta tecnología del estado de Shijiazhuang con la superficie total de más de 110.000 metros cuadrados en lo que la área de la investigación científica y technologic y de la producción es 70.000 metros cuadrados  Hasta hora, Hay 1800 empleados en Bosun quees el fabricante más grande de herramientas del diamand en China.  La marca del "Bosun" fue autorizada como la Marca Registrada muy Conocida de China por la Administración de Estado de la Industria y el Comercio en el 21 de agosto de 2009, Bosun tuvo éxito de listar en el mercado de valores y llegó a ser uno de las primeras empresas privadas aterrizando el mercado de Accion-A
 </p>
                </div>
            </div>

        </div>
    )
}
export default About;
